import React from "react";
import MoviesItems from "./MoviesItems";
import AliceCarousel from "react-alice-carousel";

const MoviesList = ({ movies, onMovieSelect }) => {
  const renderList = movies.map(movie => {
    return (
      // <MoviesItems
      //   movie={movie}
      //   key={movie.Title}
      //   onMovieSelect={onMovieSelect}
      // />
      <img className="ui tiny image" src={1} alt={movie.Title} />
    );
  });
  // return <AliceCarousel mouseDragEnabled>{renderList}</AliceCarousel>;
  <AliceCarousel mouseDragEnabled>
    <img src={movies[0].Poster} className="yours-custom-class" />
    <img src={movies[1].Poster} className="yours-custom-class" />
    <img src={movies[2].Poster} className="yours-custom-class" />
    <img src="/img4" className="yours-custom-class" />
    <img src="/img5" className="yours-custom-class" />
  </AliceCarousel>;
};

export default MoviesList;
